import React from 'react';
import { theme } from './theme';
import Button from './components/Button';
import './App.css';

function App() {
  return (
    <div className="app">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1 className="hero-title">Hi, I'm Kate ðŸ‘‹</h1>
          <p className="hero-subtitle">
            Product Designer learning to code. Building beautiful, functional 
            design systems and bringing them to life.
          </p>
          <div className="hero-buttons">
            <Button variant="primary" size="lg">Get in touch</Button>
            <Button variant="outline" size="lg">View my work</Button>
          </div>
        </div>
      </section>

      {/* Skills Section */}
      <section className="skills">
        <h2 className="section-title">What I Do</h2>
        <div className="cards">
          <Card 
            emoji="ðŸŽ¨"
            title="Product Design"
            description="Crafting intuitive user experiences and beautiful interfaces that users love."
          />
          <Card 
            emoji="ðŸ’»"
            title="Design Systems"
            description="Building scalable, maintainable design systems that bridge design and development."
          />
          <Card 
            emoji="âš¡"
            title="Frontend Code"
            description="Bringing designs to life with React, learning to ship real products."
          />
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta">
        <h2 className="cta-title">Let's work together</h2>
        <p className="cta-text">
          I'm always interested in hearing about new projects and opportunities.
        </p>
        <Button variant="primary" size="lg">Contact me</Button>
      </section>
    </div>
  );
}

// Card Component
function Card({ emoji, title, description }) {
  return (
    <div 
      className="card"
      style={{
        backgroundColor: theme.colors.surface.raised,
        padding: `${theme.spacing[8]}px`,
        borderRadius: `${theme.radius.lg}px`,
        border: `1px solid ${theme.colors.border.subtle}`,
      }}
    >
      <div className="card-emoji">{emoji}</div>
      <h3 className="card-title">{title}</h3>
      <p 
        className="card-description"
        style={{ color: theme.colors.text.secondary }}
      >
        {description}
      </p>
    </div>
  );
}

export default App;
